# coding=utf-8

from hashlib import md5
import MySQLdb
import MySQLdb.cursors
import base64

# payjs 接口签名
def signData(dic_data):
    sign = ''
    data = sorted(dic_data)
    for key in data:
        sign += key + '=' + str(dic_data[key]) + '&'
    sign = md5((sign + 'key=C55AAvaYwJN9BA61').encode('utf-8')).hexdigest()
    return sign.upper()


# 存储用户的手写签名
def save_pic(filename, baseString):
    # baseString = "%E2%80%A6%E2%80%A6"
    # baseSs=""
    if len(baseString)==0:
        return "图片为空"
    fm=filename+".png"
    with open('sign_pic/%s' % fm, 'wb') as fn:
        fn.write(base64.b64decode(baseString))
    return "success"

